import React from 'react';
import './contact.css';

const Contact = () => {
  return (
    <div className="contact-container">
      <h2>Contact Us</h2>
      <h3>Address</h3>
      <p>Thiruvananthapuram International Airport <br></br>Airport Rd, Chackai <br>
      </br>Thiruvananthapuram, Kerala PIN-695024
      </p> <br></br>
      <p>If you have any queries, feel free to reach out to us:</p><br></br>
      <p>Email: <a href="mailto:feedback@flightapptvm.com">feedback@flightapptvm.com</a></p> 
      <p>Contact Number <br></br>
        Domestic : 0471-2702311 <br></br>
        International:+1-800-555-5555</p>
    </div>
  );
};

export default Contact;
